INSERT INTO `entradas` (`id`, `usuario_id`, `categoria_id`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(19, 1, 7, '¡Sueñan con el bicampeonato! Alianza Lima ganó el Clausura y clasificó a la final de la Liga 1 Betsson', 'El sueño del bicampeonato es posible en La Victoria. Bajo un espectacular marco por un Matute abarrotado, Alianza Lima derrotó 2-0 a ADT este domingo y se consagró como ganador del Torneo Clausura, resultado que le permite acceder de manera directa a la final de la Liga 1 Betsson 2022.\r\n\r\nLa última fecha del Clausura ofrecía varios escenarios para los playoffs del campeonato, pero un camino brindaba la claridad: Alianza Lima ganando, seguía en carrera por el título. Así fue.\r\n\r\nJugando al ritmo del empuje de su público en el Alejandro Villanueva, el elenco de Guillermo Salas buscó desde el inicio establecer la diferencia para sentirse más seguro. Hernán Barcos tuvo una primera ocasión que dejó pasar y luego el cuadro de Tarma respondió obligando a la intervención de Franco Saravia, que desvió un balón que dio en el travesaño.\r\n\r\nEn paralelo desde el Gallardo, Sporting Cristal ganaba por el tanto de Joffré Escobar y se colocaba como vencedor del Clausura y en la final del campeonato. Lejos de sentir la presión, Alianza respondió con su goleador. El \'Pirata\' se repuso de la ocasión desperdiciada y firmó el 1-0.\r\n\r\nLos blanquimorados vencían y nuevamente tenían el escenario a favor. Administrar las ocasiones del juego le permitió solo unos minutos después dar con ese gol para dejar ir las tensiones.\r\n\r\nPablo Míguez, que se ganó la titularidad con Guillermo Salas, colocó el 2-0 a los 29\' y ya sentenció el partido y la definición.', '2022-10-30', );
INSERT INTO `entradas` (`id`, `usuario_id`, `categoria_id`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(20, 1, 7, 'Max Verstappen ganó el GP de México e impuso récord de victorias en una temporada', 'El neerlandés Max Verstappen, piloto de Red Bull y bicampeón del mundo, dominó de principio a fin y ganó sin discusión el Gran Premio de México de la Fórmula 1 este domingo en el Autódromo Hermanos Rodríguez.\r\n\r\nCon un ritmo impresionante, Verstappen logró su victoria número 14 en 2022 para establecer un nuevo récord de más triunfos en una temporada. Esta es la cuarta consagración de Verstappen en México: antes lo hizo en 2017, 2018 y 2021.\r\n\r\n\"Me ayudó mucho la largada para mantener el liderato el resto de la carrera, el ritmo de carrera fue fantástico\", dijo Verstappen tras recorrer los 305,354 kilómetros de la carrera en 1 hora 38:36.729. \"Ha sido un año increíble y vamos a ir por más\".\r\n\r\nEl piloto británico Lewis Hamilton (Mercedes) terminó la carrera en segundo lugar a 15 segundos con 186 milésimas de Verstappen.\r\n\r\nLa expectativa de ver al local Sergio \'Checo\' Pérez (Red Bull) ganar la carrera ante su público no pudo cumplirse, ya que el mexicano registró la vuelta más rápida, pero acabó tercero en la general afectado por una parada en pits de cinco segundos.', '2022-10-30', );
INSERT INTO `entradas` (`id`, `usuario_id`, `categoria_id`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(21, 2, 9, 'Tres muertos en enfrentamiento entre supuestos barristas en Jesús María', 'Tres muertos es el saldo que dejó un enfrentamiento entre supuestos barristas en la segunda cuadra de la avenida Cuba, en el distrito limeño de Jesús María; hecho ocurrido poco antes de la definición del Torneo Clausura de la Liga 1.\r\n\r\nFuentes policiales confirmaron a RPP Noticias que uno de los presuntos barristas -identificado como Marco Ricardo Campos Huamonte (41)- murió en el mismo lugar del enfrentamiento; mientras que otros dos, Deo Ejandro Medina Ramírez y Carlos Alberto Zegarra Soto, resultaron heridos de gravedad, falleciendo minutos después, en el Hospital Rebagliati.\r\n\r\nSegún vecinos consultados por RPP Noticias, el enfrentamiento se produjo al promediar la 1:00 p.m., cuando los supuestos barristas de Alianza Lima transitaban por la avenida Alejandro Tirado y, presuntamente, se toparon con presuntos barristas de Universitario de Deportes.', '2022-10-30', );
INSERT INTO `entradas` (`id`, `usuario_id`, `categoria_id`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(22, 2, 9, 'SMP: intervienen local clandestino donde se realizaba fiesta con menores de edad', 'La Policía Nacional del Perú (PNP), en conjunto con el personal del Serenazgo de la Municipalidad de San Martín de Porres (SMP), intervinieron esta madrugada un local clandestino, ubicado en la cuadra 7 de la calle Joaquín Capella, donde participaban más de 200 personas.\r\n\r\nLos vecinos de la zona reportaron al Rotafono y a las autoridades que no podían descansar ante la bulla que provenía de la cochera que ha sido adaptada como local. Al acercarse a este punto de SMP, los serenos y los efectivos policiales se dieron con la sorpresa de que la mayoría de participantes eran menores de edad.\r\n\r\n“El gran número [de asistentes] eran menores de edad, no fluctúan los 22 años”, detalló -a RPP Noticias- el gerente de seguridad Ciudadana de la Municipalidad de SMP, José Matta.\r\n\r\nA pesar de que el local está cerca de la sede de la municipalidad distrital y la Dirincri-Norte, los vecinos denunciaron que no es la primera vez que se realizan esta clase de eventos en el local.', '2022-10-30', );
INSERT INTO `entradas` (`id`, `usuario_id`, `categoria_id`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(23, 2, 8, 'Compra de urea: ¿Cómo afecta a los agricultores la incertidumbre respecto a la llegada del fertilizante a nuestro país?', 'El pasado 8 de octubre, el Ministerio de Desarrollo Agrario y Riego (Midagri) anunció la apertura del cuarto proceso internacional de compra de 44 mil toneladas de urea, luego de que los tres primeros no llegaron a concretizarse.\r\n\r\nSin embargo, cuando ya se tenía a los postores finalistas, la Contraloría advirtió de irregularidades en los documentos presentados por las empresas que ocuparon los tres primeros puestos en la licitación: Prime Charters International LTD,  Lusso Istanbul y Exper Ats Ihracat, respectivamente.\r\n\r\nAnte ello, el último miércoles, la titular del Midagri, Jenny Ocampo, en diálogo con RPP Noticias, señaló que la proveedora sería la empresa que quedó en cuarto puesto, Direcagro, y que se iban a firmar los contratos de adjudicación \"en las próximas 48 horas\". No obstante, hasta la fecha, aún no se ha tenido nuevas noticias sobre el proceso. \r\n\r\nLa situación solo ha contribuido a aumentar la incertidumbre y desesperación de los agricultores ante la imposibilidad de tener urea a tiempo. Además, ya anuncian paralizaciones en varias regiones del país. ¿Cómo les afecta esta recurrente imposibilidad del Midagri de garantizar efectivamente la llegada del fertilizante? En esta nota, constatamos que el problema se ha hecho mucho más complejo.', '2022-10-30', );
INSERT INTO `entradas` (`id`, `usuario_id`, `categoria_id`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(24, 2, 10, 'Elon Musk toma el control de Twitter y despidió a sus máximos ejecutivos', 'Elon Musk, fundador de Tesla y SpaceX, tomó este jueves el control de Twitter tras haber concluido la compra de la red social por 44 000 millones de dólares, según varios medios especializados de Estados Unidos.\r\n\r\nTras meses de culebrón, el hombre más rico del mundo despidió inmediatamente al director ejecutivo, Parag Agrawal, así como al director financiero, Ned Segal, y a la encargada de asuntos jurídicos, Vijaya Gadde, según The Washington Post.\r\n\r\nTwitter no respondió de inmediato a una solicitud de la AFP al respecto.\r\n\r\nMusk tenía hasta el viernes para cerrar la compra de la red social, de lo contrario se habría celebrado un juicio en noviembre.\r\n\r\nLa operación se alargaba desde que lanzó una oferta de compra por 44 000 millones de dólares a finales de abril, que Twitter aceptó a regañadientes.\r\n\r\nEl multimillonario trató luego de revertir el acuerdo de manera unilateral a principios de julio, acusando a la empresa de haberle mentido, pero el consejo de administración de la red social llevó el asunto ante los tribunales.\r\n\r\nHasta que las señales de que la operación estaba finalmente en curso se multiplicaron a lo largo de la semana.\r\n\r\nEl hombre más rico del mundo concurrió por ejemplo a la sede de la empresa el miércoles, y en su perfil de Twitter cambió su presentación a \"Chief Twit\", una ironía ya que \"twit\" quiere decir \"cretino\" en inglés.\r\n\r\nAdemás, el New York Stock Exchange, la bolsa donde cotiza Twitter, indicó que la acción de la plataforma sería suspendida de las transacciones el viernes antes de la apertura de la sesión.', '2022-10-30', );
INSERT INTO `entradas` (`id`, `usuario_id`, `categoria_id`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(25, 2, 10, 'La Unión Europea prohibirá la venta de autos a gasolina y diesel desde 2035', '\r\nLa Unión Europea planea la salida gradual de los autos a gasolina y diesel.\r\nLa Unión Europea planea la salida gradual de los autos a gasolina y diesel. | Fuente: Unsplash\r\nLa Unión Europea sigue avanzando en sus objetivos de reducir las emisiones y acordó prohibir la venta de autos nuevos de combustión (diesel y gasolina) en 2035.\r\n\r\nEsto significa que, a partir de aquella fecha, todos los autos tendrán que ser completamente eléctricos, ya que la venta de vehículos híbridos también quedará prohibida.\r\n\r\nEl acuerdo forma parte del programa “Fit For 55” de la Unión Europea, que tiene la ambiciosa meta de reducir sus emisiones de carbono hasta un 100% en 2050.', '2022-10-30', );
INSERT INTO `entradas` (`id`, `usuario_id`, `categoria_id`, `titulo`, `descripcion`, `fecha`, `imagen`) VALUES
(26, 1, 11, 'Fin del estado de emergencia: ¿estamos preparados para levantar todas las restricciones anticovid?', 'El doctor Raúl Urquizo, decano del Colegio Médico del Perú, se refirió al levantamiento del estado de emergencia por la COVID-19, decretado por el Gobierno el 27 de octubre.\r\n\r\n\"Estamos frente a una realidad. Nueva ministra, nuevos problemas. Hay que buscar alternativas de solución. Evidentemente que tarde o temprano las restricciones se iban a retirar\", comentó en Ampliación de Noticias. \r\n\r\nSin embargo, consideró que el Ministerio de Salud (Minsa) debería tener un plan de contingencia en caso de una nueva ola de coronavirus, como la que ya se vive en Europa.\r\n\r\n\"Lo que sí nos preocupa es que qué pasa si aparece una nueva ola. Si hay un programa de contingencia. Por lo menos el Minsa, no ha señalado qué va a pasar si hay una mayor demanda, porque muchos establecimientos han comenzado a desactivar las unidades que atendían los pacientes con covid\", recordó.\r\n\r\n\"Nos preocupa que la cobertura de inmunizaciones no son las más optimas de la COVID-19. Hay el riesgo de que nuevamente aparezca. En Europa está volviendo a aparecer nuevas variantes. Puede no ser tan grave, pero el problema es que el sistema de salud del país está deteriorado\", aseveró Urquizo.\r\n\r\nEl especialista señaló que que \"los centros de salud del primer nivel no están equipados, no tienen equipos, no tienes profesionales, no hay medicinas\", lo cual debería ser \"la primera barrera de contención\".\r\n\r\n\"Las citas no las están dando inmediatanente, no hay recursos. Hay una deficiencia y no se está tomando con seriedad la crisis sanitaria. Debieron consultar y hacer una evaluación técnica. (El estado de emergencia) puede levantarse, pero tienen que tener un programa de contingencia\", apuntó.', '2022-10-30', );

